import React, { useState } from 'react';
import {
Collapse,
Navbar,
NavbarToggler,
NavbarBrand,
Nav,
NavItem,
NavLink,
} from 'reactstrap';
import "../App.css";


const Header = (props) => {
const [isOpen, setIsOpen] = useState(false);

const toggle = () => setIsOpen(!isOpen);

return (
    <div className="container">


{/* <canvas class="particles-js-canvas-el" width="2864" height="486" ></canvas> */}
    <Navbar className="navbar  navbar-dark  "  expand="md">
        <NavbarBrand href="/home"><div className="logo1"></div></NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar style={{color:'red'}}>
        <Nav className="mr-auto" navbar>
            <NavbarBrand>
            <NavLink href="/home/" className="font">Home</NavLink>
            </NavbarBrand>
            <NavbarBrand>
            <NavLink href="/marketTrack" className="font">Marketrack</NavLink>
            </NavbarBrand>
            <NavbarBrand>
            <NavLink href="/predict" className="font">Stockfaq</NavLink>
            </NavbarBrand>
            <NavbarBrand>
            <NavLink href="/about" className="font">About</NavLink>
            </NavbarBrand>
        </Nav>
        </Collapse>
    </Navbar>
    <br />
    </div>
);
}

export default Header;
